import React from 'react';
import { Switch, Route, Redirect } from 'react-router-dom'
import Login from './pages/Login';
import Layout from './pages/Layout';

function App () {
    return (
        <Switch>
            <Route exact path='/login' component={Login} />
            <Route exact path='/'  >
                <Layout />
            </Route>
            <Redirect to={'/login'} />
        </Switch >
    );
}

export default App;
